<p>–ß–∏ –∑–∞—Ü—ñ–∫–∞–≤–∏–≤—Å—è –í–∞–º–∏ ¬†–∫–∞–Ω–¥–∏–¥–∞—Ç, —á–∏ –≤—ñ–¥—á—É–≤–∞—î –≤—ñ–Ω –ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ –∑ —Å–∞–º–∏–º–∏ —á–∞—Ä—ñ–≤–Ω–∏–º–∏ –∂—ñ–Ω–∫–∞–º–∏ 30 - 50 —Ä–æ–∫—ñ–≤. –ó–Ω–∞–π–æ–º—Å—Ç–≤–∞ —Ç—ñ–ª—å–∫–∏ –¥–ª—è —Ä–µ–∞–ª—å–Ω–∏—Ö —Å—Ç–æ—Å—É–Ω–∫—ñ–≤, –¥–µ –≤–∂–µ –±–∞–≥–∞—Ç–æ –ø–∞—Ä –∑–Ω–∞–π—à–ª–∏ —Å–µ–±–µ, —Ç–µ–ø–µ—Ä —ñ –í–∞—à–∞ —á–µ—Ä–≥–∞ —Å—Ç–∞–≤–∞—Ç–∏ —â–∞—Å–ª–∏–≤–∏–º–∏ —Ç–∞ –∑–∞–∫–æ—Ö–∞–Ω–∏–º–∏. –ò–ª–∏ –ø—Ä–µ–¥–ª–æ–∂–∏—Ç—å —É—Å–ª—É–≥–∏? –î–æ–±–∞–≤—å—Ç–µ –í–∞—à–µ –∏–Ω—Ç–∏–º –æ–±—ä—è–≤–ª–µ–Ω–∏–µ –ø—Ä—è–º–æ —Å–µ–π—á–∞—Å! –•–æ—á—É —Å–µ–π—á–∞—Å! –ì–ª–∞–≤–Ω—ã–µ —Ä—É–±—Ä–∏–∫–∏ –ò–Ω—Ç–∏–º–û–ö –ì–∞–¥—è—á –†—É–±—Ä–∏–∫–∏ –≤ —Ä–∞–∑–¥–µ–ª–µ "–ò–Ω—Ç–∏–º –°–µ–∫—Å –∑–Ω–∞–∫–æ–º—Å—Ç–≤–∞" –ì–∞–¥—è—á –ì–ª–∞–≤–Ω—ã–µ —Ä—É–±—Ä–∏–∫–∏ –ò–Ω—Ç–∏–º–û–ö –ì–∞–¥—è—á : –ó–Ω–∞–∫–æ–º—Å—Ç–≤–∞ –ì–∞–¥—è—á , –≠—Å–∫–æ—Ä—Ç —É—Å–ª—É–≥–∏ –ì–∞–¥—è—á , –ò–Ω—Ç–∏–º —Ç–æ–≤–∞—Ä—ã –ì–∞–¥—è—á , –°—Ç—Ä–∏–ø—Ç–∏–∑ –ì–∞–¥—è—á , –ò–Ω—Ç–∏–º –°–µ–∫—Å –∑–Ω–∞–∫–æ–º—Å—Ç–≤–∞ –ì–∞–¥—è—á , –ë–î–°–ú –∑–Ω–∞–∫–æ–º—Å—Ç–≤–∞ –ì–∞–¥—è—á , –ù–µ—Ç—Ä–∞–¥–∏—Ü–∏–æ–Ω–Ω—ã–µ –∑–Ω–∞–∫–æ–º—Å—Ç–≤–∞ –ì–∞–¥—è—á , –£—Å–ª—É–≥–∏ –º–∞—Å—Å–∞–∂–∞ –ì–∞–¥—è—á , –†–∞–±–æ—Ç–∞ –∏ –≤–∞–∫–∞–Ω—Å–∏–∏ –ì–∞–¥—è—á.</p>
<p>–†—É–±—Ä–∏–∫–∏ –≤ —Ä–∞–∑–¥–µ–ª–µ "–ò–Ω—Ç–∏–º –°–µ–∫—Å –∑–Ω–∞–∫–æ–º—Å—Ç–≤–∞" : –ì—Ä—É–ø–ø–æ–≤–æ–π —Å–µ–∫—Å –ì–∞–¥—è—á , –ü—Ä–æ—Å—Ç–∏—Ç—É—Ç–∫–∏ –ì–∞–¥—è—á , –ò—â—É –∂–µ–Ω—â–∏–Ω—É –ì–∞–¥—è—á , –ò—â—É –º—É–∂—á–∏–Ω—É –ì–∞–¥—è—á , –ì–æ—Å–ø–æ–∂–∞ –∏—â–µ—Ç —Ä–∞–±–æ–≤ –ì–∞–¥—è—á , –†–∞–±—ã –∏—â—É—Ç –≥–æ—Å–ø–æ–∂—É –ì–∞–¥—è—á , –ì–æ—Å–ø–æ–¥–∏–Ω –∏—â–µ—Ç —Ä–∞–±–æ–≤ –ì–∞–¥—è—á , –†–∞–±—ã –∏—â—É—Ç –≥–æ—Å–ø–æ–¥–∏–Ω–∞ –ì–∞–¥—è—á , –î–µ–≤—Å—Ç–≤–µ–Ω–Ω–æ—Å—Ç—å –ì–∞–¥—è—á , –¢–æ–≤–∞—Ä—ã –æ—Ç —Å–µ–∫—Å —à–æ–ø–æ–≤ –ì–∞–¥—è—á , –ù–æ—à–µ–Ω–Ω–æ–µ –Ω–∏–∂–Ω–µ–µ –±–µ–ª—å–µ –ì–∞–¥—è—á , –î–ª—è –¥—Ä—É–∂–±—ã –ì–∞–¥—è—á , –î–ª—è –ø–µ—Ä–µ–ø–∏—Å–∫–∏ –ì–∞–¥—è—á , –î–ª—è –≤–∏—Ä—Ç—É–∞–ª—å–Ω–æ–≥–æ —Ä–æ–º–∞–Ω–∞ –ì–∞–¥—è—á , –î–ª—è —Å–æ–≤–º–µ—Å—Ç–Ω–æ–≥–æ –æ—Ç–¥—ã—Ö–∞ –ì–∞–¥—è—á , –î–ª—è —Å–µ—Ä—å–µ–∑–Ω—ã—Ö –æ—Ç–Ω–æ—à–µ–Ω–∏–π –ì–∞–¥—è—á , –î–ª—è –º–∞—Ç–µ—Ä–∏–∞–ª—å–Ω–æ–π –ø–æ–¥–¥–µ—Ä–∂–∫–∏ –ì–∞–¥—è—á , –£—Ç–µ—Ä—è–Ω–Ω—ã–µ —Å–≤—è–∑–∏ –ì–∞–¥—è—á , –î—Ä—É–∑—å—è –ø–æ –∏–Ω—Ç–µ—Ä–µ—Å–∞–º –ì–∞–¥—è—á , –ü–æ–∏—Å–∫ –ø–æ–ø—É—Ç—á–∏–∫–æ–≤ –ì–∞–¥—è—á , –í–µ—á–µ—Ä–∏–Ω–∫–∏ –∏ –∞–Ω–æ–Ω—Å—ã –º–µ—Ä–æ–ø—Ä–∏—è—Ç–∏–π –ì–∞–¥—è—á , –ú–∞—Å—Å–∞–∂ –æ—Ç –∂–µ–Ω—â–∏–Ω –ì–∞–¥—è—á , –ú–∞—Å—Å–∞–∂ –æ—Ç –º—É–∂—á–∏–Ω –ì–∞–¥—è—á , –°—Ç—Ä–∏–ø—Ç–∏–∑ –æ—Ç –º—É–∂—á–∏–Ω –ì–∞–¥—è—á , –°—Ç—Ä–∏–ø—Ç–∏–∑ –æ—Ç –∂–µ–Ω—â–∏–Ω –ì–∞–¥—è—á , –≠—Å–∫–æ—Ä—Ç –¥–ª—è –∂–µ–Ω—â–∏–Ω –ì–∞–¥—è—á , –≠—Å–∫–æ—Ä—Ç –¥–ª—è –º—É–∂—á–∏–Ω –ì–∞–¥—è—á , –†–∞–±–æ—Ç–∞ –¥–ª—è –∂–µ–Ω—â–∏–Ω –ì–∞–¥—è—á , –†–∞–±–æ—Ç–∞ –¥–ª—è –º—É–∂—á–∏–Ω –ì–∞–¥—è—á , –õ–µ—Å–±–∏ –∑–Ω–∞–∫–æ–º—Å—Ç–≤–∞ –ì–∞–¥—è—á , –ì–µ–π –∑–Ω–∞–∫–æ–º—Å—Ç–≤–∞ –ì–∞–¥—è—á.</p>
